import React from 'react'
import Navbar from '../components/UIComponents/Navbar'
import Cards from '../components/UIComponents/Cards'
import * as imgSrc from '../components/UIComponents/imgUrl'
import FrontPage from '../components/UIComponents/FrontPage'
import '../styles/card.css'

class Home extends React.Component{
  constructor(props){
    super(props)
    this.state = {
        data: null
      };
      fetch('/api/home')
        .then(res => res.json())
        .then(responses => this.setState({ data: responses.map(response=>response) }));

  }


  render(){

    return(
      <div >
      <Navbar />
      <FrontPage />
      <section id="container-cards">
      <div className="container" >
        <div className="flex-container">
          <Cards name={this.state.data.name[0]} imgUrl={imgSrc.react_img} />
          <Cards name="Redux" imgUrl={imgSrc.redux_img} />
          <Cards name="JS" imgUrl={imgSrc.JS_img} />
        </div>
        <br/> <br/><br/>
      </div>
      </section>
      {console.log(this.state.data)}
      </div>
    )
  }
}



export default Home
